import React, { useEffect } from 'react';
import styles from './randomizer.module.scss';

const Randomizer = (props) => {

	useEffect(() => {
		let chance = Math.floor(Math.Random() * 10);
		console.log(chance)
	},[])

	return (
		<div className={styles.randomizer} />
	)
}

export default Randomizer;
